INSERT INTO `site_pages` VALUES (1,1,'Welcome','Hello!','\n    <div class=\"items-top justify-center min-h-screen bg-gray-100 dark:bg-gray-900 sm:items-center sm:pt-0\"><section class=\"text-gray-700 body-font\"><div class=\"container px-8 pt-20 pb-4 mx-auto lg:px-4\"><div class=\"flex flex-col w-full mb-12 text-left lg:text-center\"><h2 class=\"mb-1 font-semibold tracking-widest text-blue-600 uppercase title-font\">\n            Your No-Code solution<br class=\"md:hidden\"/>\n                to an app for your business.</h2><h1 class=\"mb-6 text-2xl font-semibold tracking-tighter text-blue-800 sm:text-6xl title-font\">\n            Prasso \n            </h1><p class=\"mx-auto text-base font-medium leading-relaxed text-gray-700 lg:w-2-3\">\n            Fast API eXtraction Technologies - faxt - presents Prasso. \n            Prasso is a simple framework to create ANY app. Useful for fast prototyping too!\n            Use these tools to assemble your personalized mobile app, then add your team to provide access.\n            With Prasso, you designate which tabs to include in a mobile application and who can use it.</p>\n            <p>Prasso setup enables you to set up your mobile app with no code required.</p></div><div class=\"flex lg:justify-center\">\n            <a href=\"/login\" class=\"px-8 py-2 font-semibold text-white transition duration-500 ease-in-out transform rounded-lg shadow-xl bg-gradient-to-r from-blue-700 hover:from-blue-600 to-blue-600 hover:to-blue-700 focus:ring focus:outline-none\">Sign In</a></div>\n            </div></section><section id=\"section\" class=\"block\"><div class=\"container flex flex-col items-center justify-center px-10 py-2 mx-auto lg:px-48\">\n            <img alt=\"hero\" style=\"width:250px\" src=\"/images/prasso_logo.png\" class=\"object-cover object-center mx-auto mb-10 rounded-lg lg:w-full \"/></div>\n            </section></div>\n  ','html',NULL,'2021-03-09 05:43:44','2021-04-03 15:12:37','sitepage.templates.masterpage',1,0,NULL,NULL,NULL,0);
